;; **
;;; # Polynomial Regression
;; **

;; **
;;; Import the minimum required libraries to run define queries, compile them, and run the inference using compiled artifacts.
;; **

;; @@
(ns worksheets.polynomial-regression
  (:require [anglican.runtime :refer :all]
            [anglican.emit :refer [defquery]]
            [anglican.stat :refer [empirical-distribution collect-predicts collect-by collect-results]]
            anglican.infcomp.csis
            anglican.importance
            [anglican.infcomp.dists :refer :all]
            [anglican.infcomp.network :refer :all]
            [anglican.inference :refer [infer]])
  (:use [gorilla-plot core]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Define a query
;; **

;; @@
(defquery polynomial-regression [inputs outputs]
  (let [[w0 w1 w2] (doall (map (fn [std] (sample "w" (normal 0 std))) [10 1 0.1]))]
    (doall (map (fn [input output]
                  (observe (normal (+ w0 (* w1 input) (* w2 input input)) 0.01) output))
                inputs
                outputs))
    [w0 w1 w2]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheets.polynomial-regression/polynomial-regression</span>","value":"#'worksheets.polynomial-regression/polynomial-regression"}
;; <=

;; @@
(def w0 2)
(def w1 1)
(def w2 0.1)
(def inputs (vec (repeatedly 10 #(sample* (uniform-continuous -10 10)))))
(def outputs (mapv #(sample* (normal (+ w0 (* w1 %) (* w2 % %)) 0.01)) inputs))
(list-plot (map vector inputs outputs))
