;; **
;;; ## Inference
;; **

;; @@
(def w0 2)
(def w1 1)
(def w2 0.1)
(def inputs (vec (repeatedly 10 #(sample* (uniform-continuous -10 10)))))
(def test-outputs (mapv #(sample* (normal (+ w0 (* w1 %) (* w2 % %)) 0.01)) inputs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheets.polynomial-regression/test-outputs</span>","value":"#'worksheets.polynomial-regression/test-outputs"}
;; <=

;; **
;;; First, run the inference server from torch-infcomp:
;;; 
;;; `python -m infcomp.infer`
;;; 
;;; Then run the query, specifying number of particles:
;; **

;; @@
(def num-particles 100)
(def csis-states (take num-particles (infer :csis polynomial-regression [inputs test-outputs] :tcp-endpoint "tcp://localhost:6666")))
(let [inputs (sort inputs)]
  (compose
    ;; Ground truth
    (let [inputs (range -10 10 0.01)
          outputs (mapv #(+ w0 (* w1 %) (* w2 % %)) inputs)]
      (list-plot (mapv vector 
                       inputs
                       outputs)
                 :color "black"
                 :joined true))
    
    ;; Posterior
    (apply compose
           (mapv (fn [[[w0 w1 w2] weight]]
                   (let [outputs (mapv #(+ w0 (* w1 %) (* w2 % %)) inputs)]
                     (list-plot (mapv vector 
                                      inputs
                                      outputs)
                                :opacity weight
                                :color "blue"
                                :joined true)))
                 (vec (empirical-distribution (collect-results csis-states)))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheets.polynomial-regression/csis-states</span>","value":"#'worksheets.polynomial-regression/csis-states"}
;; <=

;; **
;;; Using the same number of particles, we don't have such good results with importance sampling:
;; **

;; @@
(def num-particles 100)
(def is-states (take num-particles (infer :importance polynomial-regression [inputs test-outputs] :tcp-endpoint "tcp://localhost:6666")))
(let [inputs (sort inputs)]
  (compose
    ;; Ground truth
    (let [inputs (range -10 10 0.01)
          outputs (mapv #(+ w0 (* w1 %) (* w2 % %)) inputs)]
      (list-plot (mapv vector 
                       inputs
                       outputs)
                 :color "black"
                 :joined true))
    
    ;; Posterior
    (apply compose
           (mapv (fn [[[w0 w1 w2] weight]]
                   (let [outputs (mapv #(+ w0 (* w1 %) (* w2 % %)) inputs)]
                     (list-plot (mapv vector 
                                      inputs
                                      outputs)
                                :opacity weight
                                :color "blue"
                                :joined true)))
                 (vec (empirical-distribution (collect-results is-states)))))))
